window.bookSummaryJSON = "<p><b>Once the night comes...</b> </p> <p>Will Thorne is living a nightmare, his sanity slowly being drained away by a force he can't control. His talents have made him the perfect assassin for hire. But as he loses his grip on reality, there is no calming him - until he finds his next target: the mysterious Holly Evernight. </p> <p><b>Love must cast aside the shadows</b> </p> <p>Holly cannot fathom who would put a contract on her life, yet the moment she touches Will, the connection between them is elemental, undeniable - and she's the only one who can tame his bouts of madness. But other assassins are coming for Holly. Will must transform from killer to protector and find the man who wants Holly dead...or his only chance for redemption will be lost.</p>"; 
